inline void shift_rows() {
#pragma GCC unroll 7
    for (int row = 1; row < BLOCK_SIZE; ++row)
    {
#pragma GCC unroll 7
        for (int i = 0; i < row; ++i)
        {
            uint8_t temp = message[row][0];
#pragma GCC unroll 6
            for (int j = 0; j < BLOCK_SIZE - 1; ++j)
                message[row][j] = message[row][j + 1];
            message[row][BLOCK_SIZE - 1] = temp;
        }
    }
}

